@ResoluteCrypto @Likewise 

it makes a lot of sense, however the problem with basing trading decisions on candlesticks in a choppy market like KMD is you have pinbars everywhere and more often than not they do not signify reversals on the time frame that they should in theory... that daily does look epic, but a retracement that low seems less likely if we are in a BTC bull run for the time being, which he also claims 5-6k being higher probability. 

I'm not gonna lie though, KMDETH is disappointing me, I don't see it going much lower, as in breaking key levels, but chart looks ugly... anyways, in markets "anything can happen", so let's see
